__NUXT_JSONP__("/dripLog", (function(a,b,c,d,e,f){return {data:[{contents:[{id:"6_rrvz50in36",createdAt:a,updatedAt:b,publishedAt:a,revisedAt:b,title:"お知らせ",body:"\u003Cp\u003Eこんばんは！ @gamma_410 です。\u003Cbr\u003E今回の記事では ちょっとしたお知らせ を書きたいと思います。\u003Cbr\u003E\u003C\u002Fp\u003E\u003Ch2 id=\"he3aa402375\"\u003Eお知らせ\u003C\u002Fh2\u003E\u003Cp\u003E4月8日 から受験勉強に集中したいため浮上しないことにします。\u003Cbr\u003E(正確に言うと、できる限り浮上しないように努力するってことです......)\u003Cbr\u003E\u003Cbr\u003E理由は上記で述べた通り受験生なので、これ以上ネットに依存してしまうとリアル(現実の生活)に影響が出てしまうかなと思ったからです。\u003Cbr\u003E何か連絡がある場合は 下記に連絡してください。\u003C\u002Fp\u003E\u003Cul\u003E\u003Cli\u003ETwitter: @gamma_410 の DM \u003C\u002Fli\u003E\u003Cli\u003EDiscord: gamma#2105 の DM\u003C\u002Fli\u003E\u003Cli\u003Eメール: mail@dr-notes.work\u003C\u002Fli\u003E\u003C\u002Ful\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Ch2 id=\"ha30c14b9ae\"\u003Eちょっとしたお願い。\u003C\u002Fh2\u003E\u003Cp\u003E本当にどうでもいいことかもしれませんが、僕が居なくなっても嫌いにならないでほしいです......\u003Cbr\u003E僕がフォローする時は必ず「仲良くしたい」、「お友達になりたい」、「尊敬してる」という気持ちがある時です。\u003Cbr\u003Eもちろん、一人一人どんな方かもわかってます。(イマイチどんなことをしている方かわからない方もいますが...)\u003Cbr\u003Eなので。受験が終わって戻ってきたときもまた絡んでほしいです。(ワガママに聞こえたらごめんなさい🙇‍♂️)\u003Cbr\u003E\u003Cbr\u003E以上です。\u003Cbr\u003Eこれからもずっとよろしくね !!\u003Cbr\u003E\u003Cbr\u003Eおわり。\u003Cbr\u003E\u003Cbr\u003E\u003C\u002Fp\u003E"},{id:"pec8fvwe3",createdAt:c,updatedAt:d,publishedAt:c,revisedAt:d,title:"いろんなものを売ってきた",body:"\u003Cp\u003Eこんばんは！ @gamma_410 です。\u003Cbr\u003E今日は、ちょっと気分転換に部屋のお掃除をしていたら使っていないパソコンやらゲームやら沢山出てきたので OFF House で買い取ってもらいました。\u003Cbr\u003E\u003C\u002Fp\u003E\u003Ch2 id=\"hfbc8e593cb\"\u003E買取してもらったもの\u003C\u002Fh2\u003E\u003Cul\u003E\u003Cli\u003Eノートパソコン 2台\u003C\u002Fli\u003E\u003Cli\u003EiMac 1台\u003C\u002Fli\u003E\u003Cli\u003EPS2 1台\u003C\u002Fli\u003E\u003Cli\u003Eキーボード 1個\u003C\u002Fli\u003E\u003Cli\u003Eマウス 2個\u003C\u002Fli\u003E\u003Cli\u003Eヘッドフォン 1個\u003C\u002Fli\u003E\u003Cli\u003Eクラシックギター (初めて買った中古ギター) 1本\u003C\u002Fli\u003E\u003Cli\u003Eスピーカーアンプ 1個\u003C\u002Fli\u003E\u003Cli\u003Eその他ケーブル \u003C\u002Fli\u003E\u003Cli\u003Eスプラトゥーン2 \u003C\u002Fli\u003E\u003C\u002Ful\u003E\u003Cp\u003E\u003Cstrong style=\"color:#c16faa\"\u003E合計 9,400円\u003C\u002Fstrong\u003E\u003Cbr\u003E\u003Cbr\u003Eということで、詳しい値段までは覚えていませんが\bこんなにお金になりました。\u003Cbr\u003E新しいサービスのための貯金に回そうかな......\u003Cbr\u003E\u003Cbr\u003Eお部屋がすっきりしました、売ってよかった！\u003Cbr\u003Eみなさんも、不要になったもの売ってみてください！\u003Cbr\u003E\u003Cbr\u003Eおわり。\u003C\u002Fp\u003E"},{id:"11g29mc-l",createdAt:e,updatedAt:f,publishedAt:e,revisedAt:f,title:"dr-notes.work をリニューアル",body:"\u003Cp\u003Eこんにちは！ @gamma_410. です。\u003Cbr\u003E本日、新ページのお披露目です！ﾜｰｲ。\u003Cbr\u003E\u003Cbr\u003E今回は前回の見た目を少し拡張した感じで、Bootstrap4 をベースに少し自分好みに整えてみました。\u003Cbr\u003E(少し組み合わせてるだけですが)\u003Cbr\u003E\u003C\u002Fp\u003E\u003Ch2 id=\"h89dc834b73\"\u003Eミニ機能・修正\u003C\u002Fh2\u003E\u003Cul\u003E\u003Cli\u003Eダークモードを追加しました。\u003C\u002Fli\u003E\u003Cli\u003Eアニメーションを追加しました。\u003C\u002Fli\u003E\u003Cli\u003Eブログ一覧をブロック形式にしました。\u003C\u002Fli\u003E\u003Cli\u003Eブログに Twitter と Facebook のシェアボタンを追加しました。 \u003C\u002Fli\u003E\u003Cli\u003Eブログの日付表示を整え、修正。\u003C\u002Fli\u003E\u003Cli\u003Eライトモードとダークモードでマウスカーソルが当たる時の色をちょこっと変えています。\u003C\u002Fli\u003E\u003Cli\u003E実は超微妙な修正ですが fとtの間に数ミリの間隔を作っています。\u003C\u002Fli\u003E\u003Cli\u003Eicon を修正しました... (サイズの修正です)\u003C\u002Fli\u003E\u003C\u002Ful\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Ch2 id=\"h0596837221\"\u003E最近考えてること\u003C\u002Fh2\u003E\u003Cp\u003E自分好みのCSS Frameworkを自作したい。\u003Cbr\u003ECSS を読み込むだけで自分好みのオブジェクトになるように css のちょっとしたフレームワーク的なものを作りたいなと考えています。\u003Cbr\u003Eいつになるかわかりませんが、drip のプロダクト 「lip」として公開予定です。\u003Cbr\u003Eお楽しみに。\u003Cbr\u003E\u003C\u002Fp\u003E\u003Ch2 id=\"h17d547f617\"\u003E最後に。\u003C\u002Fh2\u003E\u003Cp\u003Eこれから、受験期間に入るので当分サイトのお手入れができません。\u003Cbr\u003E今回のリニューアル工事でできる限り完成させてみました。\u003Cbr\u003E\u003Cbr\u003Eもし気に入ってくれたら 新しく追加したシェアボタンでSNS共有してみてね！\u003Cbr\u003E\u003Cbr\u003Eおわり。\u003Cbr\u003E\u003C\u002Fp\u003E"}],totalCount:3,offset:0,limit:10}],fetch:{},mutations:void 0}}("2022-04-04T15:33:15.202Z","2022-04-04T17:06:35.566Z","2022-04-03T13:10:33.304Z","2022-04-04T12:42:42.297Z","2022-04-02T10:54:36.364Z","2022-04-02T11:06:19.131Z")));